import React from 'react';
function Stats() {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col-6'>
                    <h1>10M+</h1>
                    <p>Active Customers</p>
                </div>
                <div className='col-6'>
                    <h1>300+</h1>
                    <p>Trusted Partners</p>
                </div>

            </div>
        </div>
     );
}

export default Stats;
